import React from 'react';
import {PlusIcon} from "../../Icons/Icons";

const MainContent = () => {
    return(
        <>
            <div className='border-r-[1px] border-r-gray-200 flex justify-center'>
                <div className='flex justify-start border-b-[1px] border-b-gray-200 w-[730px] h-[50px] mt-[50px] mb-[30px] gap-x-8'>
                    <PlusIcon/>
                    <span>For you</span>
                    <span>Followed</span>
                    <span>Trending</span>
                    <span>Joined</span>
                    <span>Hosted</span>
                </div>
            </div>
        </>
    )
}

export default MainContent;
